import React from 'react';
import { Row, Column } from 'react-bootstrap';
import LForm from '../components/LForm'



const styles = {
  Center: {
    textAlign: 'center',
    justifyContent: 'center',
    alignItems: 'center',
  },
  Space: {
    padding: '10px'
  },
  Frame: {
    borderStyle: 'solid',
    borderRadius: '5px'
  }

}

export default function Login() {
  return (
    <div style={styles.Center}>
      <div className="row" style={styles.Space}></div>

     <Row></Row>
      <Row>
        <div className="col-4"></div>
        <div className="col-4" style={styles.Frame}>
          <LForm />
        </div>
        <div className="col-4"></div>

      </Row>
    </div>
  )
};
